import Link from 'next/link'
// import fetch from 'isomorphic-unfetch'
const index = () => {
  return (
    <React.Fragment>
      <div>Hello</div>
      <Link href="/about">
        <a>About</a>
      </Link>
    </React.Fragment>
  )
}

Index.getInitialProps = async () => {
  const data = await fetch(
    'https://api.tvmaze.com/search/show?g=sherlock'
  ).then(res => res.json())

  console.log('Rendering...')
}

export default index
